import React, { useState } from 'react';
import axios from 'axios';
import { useNavigate } from 'react-router-dom';

const Header = () => {
  const [username, setUsername] = useState('');
  const [password, setPassword] = useState('');
  const navigate = useNavigate();

  const handleLogin = async (e) => {
    try {
    e.preventDefault(); 
     //const response = await axios.post('http://localhost:3000/', { username, password }); //Эту строчку лучше прописать в api.js в качестве отдельной функции и экспортировать её сюда (как это было сделано с getOrder())
	//И да, вроде вы обращаетесь не к тому адресу
	
     //console.log(response.data.message);
     navigate('/profile'); // Используйте функцию navigate для перенаправления на страницу профиля
    } catch (error) {
      console.error(error.response.data.message);
    }
  };
  
  return (
    <header>
    <div className='heading'>Здоровье в корзине</div>
    <h1 className='heading'>Авторизация</h1>
    <div className='container'>
      <div className='login'>
        <div className='form'>
          <form>
            <input
              type="text"
              value={username}
              onChange={(e) => setUsername(e.target.value)}
              placeholder="Имя пользователя"
            />
            <input
              type="password"
              value={password}
              onChange={(e) => setPassword(e.target.value)}
              placeholder="Пароль"
            />
            <button onClick={handleLogin}>
              Войти
            </button>
          </form>
        </div>
      </div>
    </div>
    <div class="navbar">
      <div class="thq-navbar-nav">
        <span>Журавская Е.В.<br></br>Теплякова Ю.Д.</span>
      </div>
    </div>
  </header>
  );
}

export default Header;
